import React from "react";
import background from './5Vrq.gif'
import "./style.css";
const Result = () => {
  return (
    <div className="result">
      <div className="resultBox">
        <div className="score">
        <div className="up">

          <h3>User Name</h3>
          <h2>255</h2>
        </div>

        <div className="down">
          <button id="restartBtn">Restart</button>
        </div>
        </div>
      </div>
    </div>
  );
};
export default Result;
